"155714":{"id":"155714","name":"O Dilema de Lincoln","slug":"o-dilema-de-lincoln","original_title":"Lincoln's Dilemma","overview":"Conheça um lado de Abraham Lincoln que você nunca viu antes. Nesta série documental de quatro partes, um painel diversificado de historiadores e materiais raros oferecem um olhar diferenciado sobre o homem que foi apelidado de Grande Emancipador.","first_air_date":"2022-02-17","episode_run_time":58,"vote_average":6.5,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":["EDEN Productions","Studio AKA","Kunhardt Films"],"genres":["Documentário"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/18ak0ZqtirJJKXOaIs0raZqwxiA.jpg","poster_path":"https://image.tmdb.org/t/p/original/tEu3rPYUy9fXgK6zivxyUcVhSJc.jpg","cast":["Jeffrey Wright","Bill Camp","Leslie Odom Jr."],"trailer":"2QHZR8WcUco","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/d2SlpNduCz8Kxh6Z84Ws899KTlZ.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/d2SlpNduCz8Kxh6Z84Ws899KTlZ.jpg","air_date":"2022-02-17","episode_count":4,"overview":"N/A","vote_average":8,"episodes":{"1":{"name":"O Candidato Abolicionista","overview":"Enquanto Lincoln se prepara para ser empossado, o debate sobre a escravidão leva o país a uma guerra civil.","air_date":"2022-02-17","runtime":221,"still_path":"https://image.tmdb.org/t/p/original/xRC5A8P8HplZaVoj0oM5yRPS0SQ.jpg","vote_average":7.3},"2":{"name":"Então, Como Podem Ver, o Homem Mudou de Ideia","overview":"Milhares de escravizados fogem para o norte e se juntam ao exército da União, elevando seu poderio militar. Lincoln bola uma estratégia para a reunificação.","air_date":"2022-02-17","runtime":221,"still_path":"https://image.tmdb.org/t/p/original/kN49XeFS6gumrBACethy9UGQi7J.jpg","vote_average":8},"3":{"name":"O Renascimento da Liberdade","overview":"Lincoln sanciona a Proclamação de Emancipação, mas americanos negros, como Frederick Douglass, sabem que a abolição continua distante.","air_date":"2022-02-17","runtime":221,"still_path":"https://image.tmdb.org/t/p/original/5yJC4tKmULjvV0IUnPfoeZr6k0B.jpg","vote_average":8},"4":{"name":"Um Esforço Sagrado","overview":"Lincoln é reeleito. Na sequência da guerra, ele se compromete em abolir a escravidão e a 13ª Emenda é aprovada.","air_date":"2022-02-17","runtime":221,"still_path":"https://image.tmdb.org/t/p/original/iUlZFlrVusP6X3613WL8KU1gqkr.jpg","vote_average":8.5}}}}},
