"124958":{"id":"124958","name":"Caçadores de Naufrágios Austrália","slug":"cacadores-de-naufragios-australia","original_title":"Shipwreck Hunters Australia","overview":"Uma equipe singular de audaciosos mergulhadores e cinegrafistas subaquáticos se junta a arqueólogos marítimos experientes, em busca de segredos de naufrágios há muito perdidos na vasta costa da Austrália Ocidental. Liderados por um capitão pirata obcecado, as missões combinam novas evidências e pesquisa de acervo em uma aventura completa pelo misterioso passado, em um dos lugares mais impressionantes da Terra.","first_air_date":"2022-10-05","episode_run_time":0,"vote_average":6,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["VAM Media","Fremantle Australia","Barking Mad Productions"],"genres":["Documentário"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/original/9vfBw7SNVpmTZ0rE6owWwnjoxJL.jpg","poster_path":"https://image.tmdb.org/t/p/original/wOgv3wHdBfWcaTq93eIFTJ1nEVn.jpg","cast":["Johnny Debnam","Ryan Chatfield","Andre Rerekura","Nush Freedman","Ash Sutton"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/wOgv3wHdBfWcaTq93eIFTJ1nEVn.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/wOgv3wHdBfWcaTq93eIFTJ1nEVn.jpg","air_date":"2022-10-05","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Descoberta em Alto-mar","overview":"No mar aberto ao largo da remota costa noroeste da Austrália, um local de águas profundas repleto de vida marinha conquistou o imaginário dos Caçadores de Naufrágios. Obcecados com a possibilidade de encontrar um local de naufrágio histórico, o foco deles se volta para a história dos marinheiros perdidos no mar e as famílias que eles deixaram para trás. É uma aventura cheia de surpresas, que mudará suas vidas para sempre.","air_date":"2022-10-05","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/q9XIh8R3Zn8dStBAB0TYqGPPApp.jpg","vote_average":0},"2":{"name":"Busca pelo Koombana","overview":"Os Caçadores de Naufrágios procuram um luxuoso navio de passageiros chamado Koombana, que atravessou o caminho de um ciclone mortal na remota costa noroeste da Austrália e nunca mais foi visto. Mais de 150 pessoas se perderam no mar, e a comunidade ficou devastada. A equipe está determinada a ajudar a resolver esse épico mistério do oceano.","air_date":"2022-10-05","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/3ZrNTl106Eiw59u1fuy5oFWgvQ5.jpg","vote_average":0},"3":{"name":"Hidroaviões de Broome","overview":"Um ataque surpresa durante a Segunda Guerra Mundial, na remota cidade australiana de Broome, destruiu e afundou quinze hidroaviões, dos quais cinco nunca foram encontrados. Os Caçadores de Naufrágios exploram o local desafiador, com uma das maiores variações de maré do mundo — além de tubarões, crocodilos e visibilidade quase zero debaixo d'água —, chegando aos seus limites.","air_date":"2022-10-05","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/yk7Fx0Sa9XayHqYVbTBLdfz8zgS.jpg","vote_average":0},"4":{"name":"O Naufrágio Mais Antigo da Austrália","overview":"Os Caçadores de Naufrágios investigam uma lenda épica do tempo dos piratas. O destino deles é um local selvagem em mar aberto, a 130 quilômetros da traiçoeira costa noroeste da Austrália. A equipe busca pistas em um local imponente e explora ilhas desabitadas próximas, na esperança de que essa épica história de naufrágio possa, finalmente, descansar.","air_date":"2022-10-05","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/pLsr4nxoflVxsKxcnfWr66Xgh0o.jpg","vote_average":0},"5":{"name":"Sobreviventes do Stefano","overview":"Os Caçadores de Naufrágios exploram a espetacular costa de Ningaloo, atrás de uma incrível história de tragédia e sobrevivência ocorrida há 150 anos. Eles viajam para o extremo do maior recife do planeta, em busca das peças que faltam no quebra-cabeça de um naufrágio, enfrentando correntes oceânicas extremas e revivendo as angustiantes provações de um náufrago.","air_date":"2022-10-05","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/rrGKSjAfURFQENkhUgRWwosGhFL.jpg","vote_average":0},"6":{"name":"Teoria dos Dois Naufrágios","overview":"Os Caçadores de Naufrágios se juntam aos arqueólogos marítimos do Museu da Austrália Ocidental para reinvestigar um local de naufrágio conhecido e a teoria de que um segundo navio se perdeu no mesmo local, as espetaculares Ilhas Abrolhos. A localização traiçoeira é um foco de naufrágios e biodiversidade marinha alucinante.","air_date":"2022-10-05","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/iaxKwHlsDgr9RYcqiSS2c2HeAjr.jpg","vote_average":0}}}}},
