"258558":{"id":"258558","name":"O Assassinato de Yara Gambirasio","slug":"o-assassinato-de-yara-gambirasio","original_title":"Il caso Yara: oltre ogni ragionevole dubbio","overview":"Esta série documental analisa o desaparecimento de Yara, uma garota de 13 anos, e a investigação perturbadora que abalou a cidadezinha onde ela morava.","first_air_date":"2024-07-16","episode_run_time":0,"vote_average":7.4,"number_of_seasons":1,"number_of_episodes":5,"created_by":["Gianluca Neri"],"production_companies":["Quarantadue"],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/wEixzDp4g3cUL9JndCi5rDuDTGr.jpg","poster_path":"https://image.tmdb.org/t/p/original/ctFYydd0gbkeP6KG2sp8ohxUqXz.jpg","cast":["Massimo Bossetti"],"trailer":"N/A","seasons":{"1":{"name":"Minissérie","poster_path":"https://image.tmdb.org/t/p/original/p7w2HjzC5r8ZMuLcZkEfBBB4xKK.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/p7w2HjzC5r8ZMuLcZkEfBBB4xKK.jpg","air_date":"2024-07-16","episode_count":5,"overview":"N/A","vote_average":7,"episodes":{"1":{"name":"Episódio 1","overview":"Quando Yara para de atender o telefone, a família logo desconfia. Quatro anos depois, uma pessoa suspeita é presa em circunstâncias estranhas.","air_date":"2024-07-16","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/9noS7wWT3tT1B3UcAMptfSatn2s.jpg","vote_average":4},"2":{"name":"Episódio 2","overview":"A investigação chega a um momento crítico que todos gostariam de evitar. Um depoimento gera teorias de vingança contra a família de Yara.","air_date":"2024-07-16","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/nhSPZe25kBBN6QBYQ7H7c8FVF9q.jpg","vote_average":10},"3":{"name":"Episódio 3","overview":"Massimo Bossetti fala sobre o resultado de DNA que foi crucial no caso de Yara e revela um caso extraconjugal que destruiu a família dele.","air_date":"2024-07-16","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/6LZezJQsYFlvshRFVbuSqn5Guax.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"Enquanto câmeras não são permitidas no tribunal, o julgamento segue com dúvidas sobre as testemunhas, incluindo amigas de Yara. Provas importantes são refutadas.","air_date":"2024-07-16","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/3DozGnPzj6qMbBojBNh3NWWv1qK.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"A defesa de Bossetti insiste em repetir o teste de DNA, e a promotoria é acusada de obstrução do processo. O juiz anuncia o veredicto.","air_date":"2024-07-16","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/esy8DKrG0qyeGZj4x3pF30CHRre.jpg","vote_average":0}}}}},
